import React from 'react'
import { Cookies } from 'react-cookie';
import { Redirect } from 'react-router-dom';
import { MDBDataTable } from 'mdbreact';
import './stylle.css';
const cookies = new Cookies();
class Userlist extends React.Component{
    constructor(props){
        super(props)
        this.state={
            getlist : []
        }
    }
    componentDidMount(){
        fetch(process.env.REACT_APP_NODE_URL+"/getlist")
        .then(response => response.json())
        .then(res => {
            const getlist = res.result;
            console.log(getlist)
            this.setState({ getlist });
        })
     }
    close = ()=>{
        cookies.remove('name');
        this.props.history.push('/start');
    }
    render(){
        setTimeout(myFunction, 30 * 60 * 1000);
            function myFunction(){
                cookies.remove('name');
            }
        if(cookies.get('name') === undefined) {
            return <Redirect to="/start" />
        }
       let data = {
            columns: [
              {
                label: 'Name',
                field: 'name',
                sort: 'asc',
                width: 150
              },
              {
                label: 'Position',
                field: 'position',
                sort: 'asc',
                width: 270
              },
              {
                label: 'Office',
                field: 'office',
                sort: 'asc',
                width: 200
              }
            ],
            rows: [
              {
                name: this.state.getlist.source_email,
                position: 'System Architect',
                office: 'Edinburgh',
                age: '61',
                date: '2011/04/25',
                salary: '$320'
              }
            ]
          };
        return(
                <div className ="container"><br />
                    <button className="btn btn-danger" onClick={this.close}>Close</button>
                    <table className="table table-striped table-bordered" id="example">
                        <thead className="table table-dark">
                            <tr>
                                <th>S.no</th>
                                <th>Source Email</th>
                                <th>Destination Email</th>
                                <th>Name</th>
                                <th>Action</th>
                            </tr>
                        </thead>
                        <tbody className="table table-active">
                            { this.state.getlist.map(getlist =>
                            <tr>
                                <td></td>
                                <td>{getlist.source_email}</td>
                                <td>{getlist.destination_email}</td>
                                <td>{getlist.name}</td>
                                <td>
                                    <a href="" className="btn btn-primary">Edit</a>
                                    <a href="" className="btn btn-danger">Delete</a>
                                    <a href="" className="fas fa-trash"></a>
                                </td>
                            </tr>
                            )}
                        </tbody>
                    </table>
                    <MDBDataTable
                        striped
                        bordered
                        hover
                        data={data}
                    />
                </div>
        );
    }
}
export default Userlist;
